import * as i1 from "@angular/forms";
export class LoginComponent {
    constructor() { }
    ngOnInit() {
    }
    onSubmit(f) {
        //console.log('form clicked, Username: ' + f.value['username'] +' ' + 'Password: ' + f.value['password']);
        this.login(f.value['username'], f.value['password']);
    }
    async login(username, password) {
        let loginUser = { 'email': username, 'password': password };
        console.log(loginUser);
        let options = {
            method: "POST",
            body: JSON.stringify({ query: loginUser }),
            headers: {
                'Content-Type': 'application/json'
            }
        };
        let responseObj = await fetch('/api/v1/login', options);
        let data = await responseObj.json();
        if (Object.keys(data)[0] == 'user') {
            alert('Unsucessful Login. Please Try Again');
        }
        else {
            //console.log('we have logged in!');
            console.log(data);
            if (data['role'] == 'Teacher') { // teacher
                let url = '/teacher?username=' + data['email'];
                //console.log( url );
                window.location.href = url;
            }
            else { // else it has to be a student
                window.location.href = 'https://www.espn.com/';
            }
        }
    }
}
